import React, { useEffect, useState } from 'react'
import './Systemblock.css'

function Systemblock(props) {

    let [systemarr, setsystemarr] = useState([])
    let [systemarr2, setsystemarr2] = useState([])
    let [page, setpage] = useState(1)

    useEffect(()=>{
        fetch('https://squid-app-9h43v.ondigitalocean.app/api/systems')
        .then(res=>res.json())
        .then(json=>{setsystemarr(json)})
        .then(()=>loadcontent())
    },[])



    function loadcontent(){
      console.log(systemarr.data)
      return(
        <>
              {
    systemarr.data.map((statss, index) => (

      <div className="Systems-card" id={"System-card"+index}> 
       <a href={statss.attributes.link}>
        <img src={statss.attributes.link} ></img>
        <h3>{statss.attributes.link}</h3>
        {console.log(statss)}
       </a>
      </div>
  
     ))}
        </>
      )
    }
  return (
    <>
    <div>Systemblock</div>
    <h1>{props.lange}</h1>
    <div className='Systems-Wrapper'>


    
     </div>
    </>
  )
}

export default Systemblock
